import React from 'react';
import { Link } from '@reach/router';

import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';

import NavbarLogo from '../img/navbarLogo.png';

const SiteNavbar = (props) => {
	let { bg, sticky } = props;
	console.log(bg);
	return (
		<Navbar
			expand="lg"
			sticky={sticky}
			style={style.SiteNav}
			className="siteNavbar"
		>
			<Navbar.Brand>
				<Link to="/">
					<img
						src={NavbarLogo}
						alt="navbar logo"
						style={{
							width: '4rem',
						}}
					/>
				</Link>
			</Navbar.Brand>
			<Navbar.Toggle aria-controls="basic-navbar-nav" />
			<Navbar.Collapse id="basic-navbar-nav">
				<Nav className="ml-auto">
					<Link to="/about">
						<p style={style.NavText}>About</p>
					</Link>
					<Link to="/team">
						<p style={style.NavText}>Team</p>
					</Link>
					<Link to="/">
						<p style={style.NavText}>Blog</p>
					</Link>
					<Link to="/sponsors">
						<p style={style.NavText}>Sponsors</p>
					</Link>
					<Link to="/join">
						<p style={style.NavText}>Join Us</p>
					</Link>
				</Nav>
			</Navbar.Collapse>
		</Navbar>
	);
};

const style = {
	SiteNav: {
		padding: '.8rem 2rem .8rem 2rem',
		height: '10vh',
		background: `${bg}`,
	},
	NavText: {
		fontFamily: 'Titillium Web',
		margin: '0 1rem',
		fontSize: '22px',
	},
};

export default SiteNavbar;
